import './Carrucel.css'
import Videos from '../videos/Videos'
import CarrucelInformacion from '../carrucelInformacion/CarrucelInformacion'

function Carrucel(props) {

  console.log(props.datos)

  return (
    <div className='carrucel-contenedor'>
      <CarrucelInformacion />
      <div className='carrucel'>
        {/* <Videos /> */}
      { 
        props.datos.map((dat,index)=>{
        return <Videos datos={dat} key={index}/>
        
      })
      }
      
    </div>
    </div>
    
  )
}

export default Carrucel
